    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 * ( ( - col2 ) ) NOT IN ( col1 * - col0 * + col2 + - 12, - 46 );
  - name: tab1

outputs:
  - name: q6830.out
    data: |
      51	14	96
      85	5	59
      91	47	68
